import React from 'react';
import '../css/Proficient.css';

export default () => {

    const onClick =()=>{
        alert("Hello")
    }

    return(
        <div className='container mt-5 text-center'>
            <div className='col-sm-12'>
                <h4 className='title'> Proficient </h4>
            </div>
            <div className='statement'>
                <p>I can (Thinking Skill) the (dimension of differentiation) <span onClick = {onClick}>of</span> the (subject).</p>
                <p>I will get/organize information by (research skill) and share my findings by/in (product).</p>
            </div>
        </div>
    )
}
